  [k.CONSTRUCTIVE_CRITICISM_IS_WELC]: `凡大耒多汀佝臣允主行勿穴了巳羽于旨立仿休氐壬圭疋圭呎如欠世布戌之肋几免亦水亙成入吉吶兀刁色子交矢犬冰去否匹左支夸丙丐西乙此圬估幼汗弓佐多收云汐余吶冬外尸死佃朮內內百戎孕扎朮才夕西勻兀十已免划介市伍戈今有用舌曰池仟尸方丹吒作卯仇曱水穴內一江吁臣夕如及吉毛仙戊戌叵毋火吃匣欠可毛仿伕巾凶伽冷甴卅兄屯曱毋世汕划元朽心叮住未也伉吝壬矢戍另托兀下土艾吉牟叫由伏古回予戈死托弗克伴吊両乙地米兕丈`,
  [k.NO_SPAM_OR_SELF_PROMOTION]: `幺可兄示羽充伯缶伏九西化圳色用毋臣代丘一氐犬朮下札矢安末曳`,
