  [k.FAILURE_TO_ADHERE_TO_THESE_COM]: `好住勾另仍伯加玄竹孕冰划肌企吐扣市即有什且佛几兇伶卮丸考穴已叵至米圯同弁佈下丘件伯宅亨丐夙夕旨乩伉弗日巧工已作灰刀斥仙吱妃司休旭井旦仲兮必七爻牟亡用佃扔西扛奴成凸元也充吏伽丑吃犬朽吱自刃心也名朽曲反打巴口正汀有丁弛多立四石弛它伉之二吝付刪充丁付歹內升丹勿死且己份曱余地弘共八尸手虫向仁刁色免多羊匕令自判巴吆下仲兆吉引且札兄佗三扒丞丈竹后佃氐予令丑吳仙下光去佐甲伙末主成`,
