  [k.USER_ACCOUNTS]: `卅守幺出吆毛玄以伏乃丘丫肉位吱圳`,
  [k.IN_ORDER_TO_USE_CERTAIN_F]: `卡二伉叮交斤之佛什干手池北任叫曱年舌司巳兆厄臼札包忖呎卵至冶池吒冬住氾瓜冶因呎八生毋污爪低冷八犬旦甴主冉及光弓打仗他生印文吳宇先你囚生也台帆扣允艾木此冊劫免次守史危牝呈爻因生扒因合女勾伕妄仟呂尖丸矢王弗伶布汀冊召免寺在天天乍次大帆圳凹努申危亙巴羽位行妃伴宅丞禾吊令凸午兄市名艮肉吱努兵玉亙內弗卞乏爻聿凡自耒夷刪士打助刃玄打凹老今孑亦因匣匹歹色吉刁臼向戎平字匠兑曲池西缶丫卡世件西伺勾立凹划佞危吒低任冷六卅全佗卵甘亡刎各孓几妃仁丑伯幺孕伯可已朮民兵利吏件如收由在守仗弓舟孕札并歹同吃江作吋吭企汗丫六水弗幻上免土丘乒介匝尼去伉吠伐皮止包夕丈而乏休兇忖仍奸圯聿斗子中估尺氏冉永`,
  [k.YOU_MUST_PROVIDE_ACCURATE]: `云回出存壬名吐干化羊印凸舌如卡內仔甘去中人夸夕禾內匈印以仞丞夷代仟卉冊入四田羽佇夷后平合合帆歹兇匝弛孓氐几禾多何户巳介乙努聿文子刪少吧犯毋于叼民伙汝血欠斗孔扔子千本氾卞佣玄札巨自企毋乒匝丞努回化仿艮引朵令夙左似扛缶永主吞矛尤汝伺口弘犬妄吠汗乃但先同吳乩孕刎旬奶四利各扒交兑死孕叱九吭升文仆且古奴心江巧仇友凶凹寸努曱旦佛矢了下甴好你斥吞兀亨曰任在支忙后地亙呂玉兆肋老斗字九式弗匆吏住何乏屯尼否目作皿圳色氏仗至印曲小夕午努廿她几互宅厄件千成聿伶吵名匡向戎未匆你奴企百作生牙户地扒余收呈介打卮至耒余吊瓜公汗成艾一吐四臣老戎灰`,
  [k.USE_OF_THE_SERVICE]: `仰丞三式孕汝判佔六玉立企幼弛左五囚呀叫予寺`,
