  [k.YOU_MAY_NOT_ATTEMPT_TO_GA]: `伴匝伐力池台巧托吁呀大艮交臣兇叫吐吠戌宇丐布生旭乎呆示凸因吊刎丑凡仃汁向北以氏左入血曲伽曳什吝弗印戌四小早灰朴卜仍仄呂合羽臼玄忖圳牙夭吉佛亨朵存己似竹用汀吼好汐中甩云叮伸托太弘串寸千尤朱夙臼吋大士刎斤入冬必予母匕刊如牛君午旭入劬呂去氐旨匕一`,
  [k.DROPWORKS_RESERVES_THE_RI]: `叭己卡以不卯耒住代冉木文史両乓旭四尹丹行右位妃全加予立呎氏串耒田危玉佔乒水井艮年卵凹旬任山丐由池打卮扒化竹元火羊劬巧劬吵刊并水仿戍米本又伸孑凹弗汐主夕平佇冷乩比必污天朱毋伙呃巧式一丟夫中托判札也召甴札左卜妃市呂劣匈小聿札力字代白卉肌百池朮字久犬可汁呀肌大永努`,
