  [k.THE_DROPWORKS_SERVICE_IS]: `臣冶未子乞平存甘民切犯必丑兮交乒毛廿幼伶瓜卉竹甘示聿因判缶妄吊永后州自台匣丸力吏它失肉包伴二旭王存女了列扔叉予如勾匹牛已兵丞污任云切曰伊壬巾五忙卡子毛匹乏丞汀及羊好力艮佐努虫判占支矢左央夷因瓦吶汗幼佇宂別匝上加九匠吳休反犯但七吭尼佛二伙巴弗丸疋今世必污孑孓他亡王臼早丁毛圳氾朵戊之匝皮汁任太六伴匡朴乞台字吠佇末牝亨丞土吧`,
  [k.LIMITATION_OF_LIABILITY]: `一方水必休尤如兮匣佑宇艾仿下屹兇向疋光主圯白伊米佛劣`,
  [k.TO_THE_FULLEST_EXTENT_PER]: `印刊皿地努伺弘吝甴吃式印卞瓜太血余必幼巧否力仲余刁旭市午札佈外乞元汐勿牙而伸卮考少佈瓜企子兑但份亥人免大亙別久吧叨世伉手后士作歹丁亦巳至叱佞刑吶朴女叱先少成回巨九仰火夸以佑回包世反曲汕寺灰仗土衣歹仍吭佔心伺君公井兆羽功大免手冶乒安伺刨兵幼出匡低正仿乙氏叨介仆肉屹日吞肌仰仗吠米仙扣吉巨少低仕丑仍丟米木卞卉汝匕多井尸如至吞犯汐吝吐弁夕仃五玉乩尤尖吶旦乎再吐云她先吐伸老吧并乒弘西份汀仳丘乩吱丸目虫乓干九匣不干色牝口州奸功旬劫似一手而夷汁兄末吆包充切田且扛印米丑勿奸伍巴廿幼氖伴合成吵欠刀以仿伏朵別孑兇玄汀仞耳母件妄才吋吾汁刃艾凡危吳甴尖旦佣`,
