  [k.DROPWORKS_RESERVES_THE_RI1]: `召年旦札伍朮刨兆甘巾羊尤曲元合吠瓜允冬卮曱友夙夭爪佛丑叮再份吊凡台同吭失叱瓜州史白好水巾伶托中刊兕肉卮心池旬戌佞匈同午凶丁米仞扣甴去八平汗斥刨氏收光吒舌夷巴年判你仟夫吆伸目斥幻目牟十戈両旭于汀兄伯云圭出尸臼斤汀布丘夕斥目劫水冊化亡中夭仍朴伯甩仆互大何伙共佞屯四月汕佞札已乒什宇吾帆好全大朽吵吧孓匹克月作卉冶好刪弛天丫旭仟甴可奴耒也女臼句人佈佃仆守矢木比千伐但乍伊曰孔安弔巾`,
  [k.BY_USING_THE_DROPWORKS_SERVICE]: `另穴弁污旦你汗卵几虫介才劣乏文疋乒犬牙羊吝刊伺朵氏呀式匡巨央旨申另于弘句肉交估宇穴吃污汕伍扣舌兀引牛羊匝引佇只耳印虫奶何付伙住付白乃凹肉匹仍旦乙乙低札而吶吠手乎同世甘土印戈刈安考乞止戍札刁才伺汀中`,
