  [k.SERVICE_PERSONALIZATION_PURPOS]: `几凶臼安冰羊叵圯吐互色久方成十卉兆朮佣反予仍戌奶仁刁付扛平幼估冉圭`,
  [k.TO_PERSONALIZE_USER_EXPERIENCE]: `安四升伍刨匹好寸史汕目羊仇名心匡如吱卮丸劣支田冶皿佑句升全自匠并吉必估扒安午升支云屯未札囚吼伊內户汐可支奴兕伽元州多止州屯池弁兀外主至疋扣皮吶并勿勻先二已自巴地何下廿及地耒永伽申才少伯伊犯匹云丐佑今牟巾公污次仕穴亨木串同且兑衣乃支甩叼扣乎亡忙申兵缶佣住功孑卉又似宂旬叉江氾歹呃功何爪她布之七有匠他弔勿卮冰旬任叭末乞凸元汝老刎打支尖弓吝六名圬台存牛仲伏似住吐己吏氏毛中田又工舟尸凹如匹毋她扣另百失牛予弔份丁收吒考尼它生尸曳矢兆口安尸艮忙冉奴四牙它勻艾刃曳別刀乩匠刈舛壬巳刎刀弓入大弓代扛佞夙加羊吠包叼代丑比作冰代元虫叨欠宂又划孔曲仕永六母戈化穴弓戎土低木戈圳扛兕上舌幼汀早入她仕戌反氖好艮引支乓串伊此刪扔佞寸手土伸上不仿壬了母士句仕毛皮`,
  [k.LEGITIMATE_INTEREST_WHERE_OUR1]: `司甴示艮乏幻戌心吾自丸仲仗妄可斤州別宂此吳月曳忖奴切但氐天汐余瓜佝叉中末如否宇由吁平毋令化皿弛丕休旦牝安叮再申扛仿分宂旨弓肉弘兇木甴吊工白耳旦臼舟丟耒匈丞吁色克劣吆呎白友池件旬肉羊方令且乒吞卜千仙吒汐即立企朴凸丕伐牙王兀劣化血年玉爪吱作在血皿亥匣了両圭乏吋伊吒永吉叫后污欠臼幺予只曰合申佗件互伉正佔`,
  [k.MUSIC_CURATION_PURPOSES]: `伽水肋立五仰弓之匈行公佃匝巳汁地有吝仳安佗干尤匈`,
