  [k.IMPROVEMENT_PURPOSES]: `汁失冊吵布必匈升叨令扔守子米汐她好寺目冷戎`,
  [k.TO_IMPROVE_AND_DEVELOP_OUR_SER]: `夫因夸它刎友并同曲犬已朴几并汗毛亡仆口吆皮它努兑巴千巳小呈丘爪冷早曱凡斤佐止小作兇肉回因即舛血向吳令幺乒佝兀旨今可串甴山圭丕入如毛市臣仇及汕氾牛五外克出失弛伴伏即卉并山佝免任勿似兄刃叨串丈巾向甴冶兆外充汁七又吭反犬佣佝矢克斗幻冬矛吐北年皮如孓丫尤卵凶友匠吶卡廿失兵小兮勿死卵囚匣已召亥出呀太牛午乏尸七世伕佞年伙吧分朱白片伏冷扒劫佗他吱王匡幻丐千呎呃匠凸別匈尸巳匣吧台佗艮八夸弔北吐目火主王什甩佃牙吠估伊百市瓜吒划艮吞立旨仔丁刃亨止右人扔丈合冰玄臼毋后吧再句圭仞宇叭江存刁尺佐勿井先両加尸木兆朮吵仄舟吾別冊乞玄了行共吉士少佈吶人太斥力仁內冶缶呃回吳仄肌氖幼丹屯只伊子奸吞乃字正氾加半伙安己缶吭元旭皮介矛先卞下半卵中舛吒月回永曱之吋地判列仲台圯穴君宅戌卡凸丐去吒回厄火厄尼王斗安了斥吼舟匹口左羽成叵斤老夷公此叱佐扎尸叫此朽充宂乒天入口名市仟曰乎亨司吾目生兇冊吼廿污今比也甘汗卡叉水米户死允呃匠北一入`,
  [k.MARKETING_PURPOSES]: `囚川互于刨木反旦忙水氏叱巴主乓化台毋十`,
  [k.TO_PROVIDE_USERS_OR_THE_COMPAN]: `米爻孕只卡允也呀汗示尖匝扣血尼丑央亡札手曲交叨付余劣妃仇朴巴田式弔卅奴占甴成凹低犬汁乒少乏未斤犬乩汐你己四瓜令止助巳吱死舛去穴吒用弔克伴冰回巾老再吳巾大乃甩本兀千司它至助乓戌老仰仳仃牝由吃守斥呆丞本竹它山父亨止右己石山刁刪卉矛吋古她牙行扎仟吞羽叫列王壬甩久巨口戍吭玉乓令估仟斥弔丸匕忙文失川式式再舌史冊去只匝丸刪亦甴手久伶皿仰夙于札卡幺乒汝多皮叭似旬禾王此似她工示乞吊九舛包田亡刨尼而早禾仞朵仔弗卮歹尤三爻戈廿吳毛朱兄兵口子支收呆仿夙羽六凶另司余串牛各右伉弗巧矢加乍之巨刑年冷七卵孓民巴全以巾有元占匝佗可佇劣划弘伯弁刈吧氏元元才今存已西刃叉目夭叨幺佑匈呆疋巾佛地即叮吠列佔乍即日利休付札匆亨半匈但佑禾何缶下仆匡目叩舌叭劣匈戎亦叱立囚曰曰叼式划戊乙半呃丫甴安宂夙片外弔扔因佝地汀打少矢札虫比扔申尤右召行乙如五玉匆吋助両失奸朴刑卡冶匝艾別只孓市早千太氐曱午吶叱巨布囚努及灰肌匡旭乓吁虫多吠有寸仞否佑仞生禾估夷札大佔十叼助亨未刨耒乓江羊匣吞夷充之奴干努伺云亥兇忖永皮太石成后日乞公呎判亥父`,
  [k.YOU_CAN_EASILY_OPT_OUT_FROM_RE]: `凶估丙伶任旦汀孕玉再有六口佐如甲虫友汝叨夷充疋成叭乃池串大劣劫奴永寺危外兵卞土刊臣呂丫力古凶疋匈內佗干行妃丑叩考木兀聿干死刪今卅瓦凹水友幻叵吾巴四帆兵好刊叨竹全宅斥平竹令判江共伏乍君丕年于判交勻汝克下仁缶冉千`,
  [k.CUSTOMER_SUPPORT_PURPOSES]: `爻丕幼伴世凹少云市吵划艾弓石札住寸好穴叱艾屯今江聿加`,
