  [k.LEGITIMATE_INTEREST_WHERE_OUR2]: `佗扒尺氾甘色佑次玉宇允代吉吞云朴兇化之帆旭太丁本二爻劬出考汕氐卡叨刎矛申打川仆宇乓女叱矛冊又宂冷氏丸西后勾汕口玉伕失中一小先冶交划毛孓旭朵利叵卵臣夕丟今屹戍午耳壬幻乏屹吆仔旦卵何入戍共亦多匠凶牛毋安刑劫式仿兇上托午次凸助大刃乃尺刁矢立十此午于丸印牙`,
  [k.CUSTOMER_INSIGHTS_PURPOSES]: `帆天汀扒囚匡厄冰伕士三瓦冬肉乎弔伕羊冉扛曱光伙成圳甲叭`,
  [k.TO_SHOW_HOW_FREQUENTLY_OUR_SER]: `吼后包劣孑舛叼羊伍甘吒舛代氏叵全乞吠夷犯收去判伉己乞元大元亡甲伙示別禾佈丞羊肌叨乒帆佞匡生世句歹丟丸忙尼回各功乙公去呀次乓肋妄行助布刃乏朽肌兵吃余止互不羽又支老虫宇五天土必同先了凶旭扎斗夙爪爻央舛丁巨冰仰小叱小文羽壬宅尼乒圯囚必向她污亨卜母冶伺出升亥吠吞玉叫矛伯付匈伺田仲卜串伶舛凸卜刀克休刪仔六似劫穴爪手土人位它佃舛世斤作仰耳丸州伴丞壬月二汗及曰弓污支妄王卵田乎耳佈吆孕市世由戍卅互冶亡利孓虫自乍仍佗刀帆自禾本你吼聿矢伴位光戊`,
  [k.INFORMATION_REFLECTING_USAGE_O]: `甩兀別努少有另已丘戍千奶丘何加止兄央奴兄午卡刃台及夫朴牙八斤丈羊永州戍先吵匕田伊弔聿君努吵仟出方口疋旭乩夙己吳劫吾卯守吊只下刃厄刪玄血斤汝卅弗兮佃朴幺孑宅歹伉生古串仍伏吧朴卞仔主大司心半圭支于父尺水戈皮余朱圭弗曲打入吾卅孓佈曰乓妄臼凸皿允甩方凡厄水才刑戍自冷占月干半色佑厄艾乎串仿汝加甘乏石七亙五冬奴艮仿呃穴肋亥亦瓜吁匝尤仍己冶方伸百皿包乓印尸且穴火口吃瓦冰污扔刊今朵丑予刨八井君七池太矢式句乩伶穴仞叨妄叼及甲此巨吊丕几刪汕丘氏必佞奸尼弓冰光囚田屯丐巨句牟卜`,
