  [k.WHITELISTING_AND_OTHER_DIGITAL]: `牛忙米十匹匝爪七文牛旦地肋瓜臣肉朵立大米收伸乎位也出印寺布匹民廿犯至次忖仗川正外布正吵分亦仳中字伉犯伙凸耒己生主田升`,
  [k.TO_ENSURE_WE_DO_NOT_MAKE_CLAIM]: `六比匡州川世佛及艮污州朵色吊失卡佛伽及伸匠叮孓吞兀壬加曳兆幺正必吒仔兑寺句孔矢叭尤犬心北吋令余字廿低奶孓忖生仟已兄夙加肋乩叉佔幼力又皮肋佞厄代佐丕圬巳北但午丙圳包吧西仙弘兕曰仕佞竹毛判比吒中匠凹夭久曰氏劣宂仇丕仄幻州幻伸户冰皿它劣立三冬后冰牟刈凹佔台尼正方朽至夙勾加至地白朽托此久伉巧矢又匹因平公份名止仲句存多此由打孓兆刑心列四別血成功灰后刁子匡它牝古幺串央佣圬六幼也伏伸收利几叮它舌先刎內厄六両缶圭低行瓜伶立力于午位夙汝聿因利收托吏火年化皮布冊山札乃似忙巨臼冬失仃市臣伯反入末仰五必匡因并久作不兑片犯奴冰叨丫仳曲兕圬石札夭臣母幺云千弔式共平聿可外圬扣功孔內氖右爻聿匆丙孓朵匡朮佑幼石大旨早仗兕矛矢仆方叼化臣厄江吐卜色牟吼目乙呎尤元而立內丹收久伐努判犯尤佔尺云忙丁兇叮充何江立艮吼乎人卅孑朵考丞用式帆升示即今夕佑佑歹土血戍劫低兄匡不作此吋列江央末色古呆回戊毋已仔仇地扒圯幺住几似目佞且刨企止文丸升乎山劫即吭太行土老公只幻乎汕死奶估州但干好式日刎扎主朮吃三丫户夕卡夷幼汗只瓦死妃并什三公列吐夕刑亦吁六內守化`,
  [k.WHERE_APPLICABLE_INSTEAD_THE]: `仿老且弘亨丟分母囚已扎亡肉左它匡支匣圯扎佝三何吋宂池耒令什死老丈斤丟千刑刊米三介母圯尸伺打卮汐呃伍功爪匝虫奸冬両入巴仇禾划吳占奸壬忖卅允戍打叱戌兮存方土几佛仳汝`,
