  [k.BEFORE_WE_TRANSFER_PERSONAL_DA]: `仇囚功丑字伕亦吝叨之伕加亥包代呈曳少刪吵石凶本丹伊丕巧但吭仳仁否孔且佗丹卯田方立伏屹吉壬兆吳幺行疋九匡它又衣户舌爻朴扎巾仕仇才牙巾已先吝佣弓忙份夕弗匈旬吃水尤十叼加朽作托匕反冰妃牝牝即反再次六凹朽亡朴圬兕包玉帆安佣本乃正好夷中吼呂共牝且屯土叉老介吵大矛犬召仞吆欠半刈夸父共而父州冉兆王圳好廿申夕吾行久吭冰扎反即九夷穴一氏叱匕吧比甩矢伍池企可件伕朵`,
