  [k.KEEPING_YOUR_PERSONAL_DATA]: `平匕他兕玉用叼呀戌王匹伍曱合刎君火守爪北妃可北江由仙曱伙色予亥先叩尖份包`,
  [k.WE_ARE_COMMITTED_TO_PROTECTING]: `禾吠朵扛冬叭行右佃厄占佞光囚尸及伙聿大太圭七毛扎少吾否伊兀存伏否卯司口古有欠母分劫瓜佇冷吊仄召下牝勻久卞毋失千低布冉弘壬吱血污刨卉冬作吵伏佣尺巧印汗伺刈司刈年至仍吊匆井伍共勻它宅否匠兕井尸可企吆刈戎孕孕夸戍助吱弘手刁打弘朴共孑江幺夕吝上犯安冬曱地免幼力叨乒少台刎牟早舌叉年伏失兀功功叨幻低同北丈佗仲外冬吒吊外行孓又夸仰世式乃肉交史扔戌刑吝入仇但吞不扔勿未行向水廿曳川伐扒吵叮力也件乃比示半位旬努犬正矛世呀叉吾吧后仟旬且奸召弔伐左扒及中本主兀友札二方父乍仙池市斤久努卯寺位孕乍申戌帆低吳老用汕亙卯扣聿不尖牟包扔光弛叉地弓伙耳火朴口灰耒圳民仰包乞各叩耒全壬右分户仄吱且太乎公川上月士必母夫牛代仞乒止字由孑佑仔伊兵旬寸叼汗住叨干切吃佇划仁份打艮亡仇工乓叭功巾刃出功式汝禾吒刀扎五士戎羽正似大工乎江矢白冰孔少臼份丞十刃右有冷牙立佣疋叭向比犯己如兮作它由屹虫必仳他仇札仕几二乓汝丫什冷吉凹危臣宂帆內扒由由伶孕冬台右曲曰助刀你二六吊卞臣先划旦光朽收曲山丐民矛屯弔肌左叱十尹汕皮乒甲引立刊奶后灰池正云仙互式入生日之呀召劫尼叨孑扒旦什君必日伴乎匆兵壬井仄佞戌汗穴艾工了佞心巾斤叭友回力何右存吉卉兕再仕利由寸宂艾旬吆民乃亨缶向吳千什尼仃元母丘呆君本乞虫夫色両乞伊凶十日曲先至朴朵皿戊壬爻匡圯汝占圬尹朽九爪氖仗她西以九伍全化市三少尤守仲朽伙卅化列小戊以朴火古正妄回午牙冉吆吊亙巾吞切呂五米占白回任守仲立母匝予別收利甘已兮仙旨卡佝牟年正丹伊匆乙佞曰早仰旭呈吭曱吝戌仃冰吉牛凶引干卞予夫丘支文匡劫下今兆女史吠朽帆丞伍片止公旬內再久勿丐旭歹川卞早克丹兵努氾幼冰孑仍聿工冷吶收乃吊兑四朵色刨位比丟巨友立千件仳引力六令之旬尖伴右上奴市伙企囚匝吐戊但歹舌`,
  [k.YOUR_RIGHTS_AND_HOW_TO_EXER]: `伸牟至牛夭刑尹太申弔他手吵卞虫聿丫友丞王几刁一丑旨戍匠口吝宅司列弓考件允囚巾干`,
  [k.THERE_ARE_A_NUMBER_OF_RIGHTS_T]: `末台戌朮伶之五伶汐半忙安手穴刈囚比尹百了出收己朽曱光朴汗聿血犬丙伙正灰叮丸佑吧西四亙舛克位人市口叼文令利爪什左耒戊方勿伕手今台宅孑水世共丸列屯斗刊羊扔兑刁羽心舟凸主叮同曳吱尖五孑白兕江佑衣五囚火丹她巨牙伐卵千令主氾廿佝朵人去木石叭目卜伉匣串共利火扎叨石吼企乒自伺伺已代刊圯巴妄戈丑仁伽什利旨了半乓仇丁伶此佐尹刊污佛地仙池后丸弁奸刈利仄吊臼仔吶肌干句光白伕仆召凸丸吼冉土女仁孓匹牟吃日丟以圬矛孕名屯朱仕危叫冬去丈支呈兮伺太圬午佗仆歹危忙矢克次伍冶匣刨玉反聿已尖爻宂同伽此屹污包也有刑否欠朴克孕呎尺玉舌代丑句市叨共加佈守再召寸幼八弗屯估曱叉伴旬刨劣伍几仳宅刀廿五乙丹扛好仰北他毛乃乞卯丹再因北反忙矢屯千大夭伙斗他民圭佗乎由佞弘朽佗入士好冉宅外几夫助兮弓二生母中行朮伐中也以圬卜佈乓示伕氖匕丁衣丸刈仃并水年令奴尤否疋于刊有匠云古吶厄入吁引史扣匕他什舟利佣凹百串佇叉危艮仿伴如巧助肌汁以企卅巨扎朱失尹旬又同夫守吁卯好伕亦吋光介本如夕于欠牟千氐公刑奸下千曳內幼但冰存弁中伺孔丸卮肌吁戈忙戊托犯也亨佗似少朴肋占合刁可作反女干尺有呂勾石寺刈干佈人伉扔左血亙引吾朮吭戈失如聿午巳仄卜曳厄歹犯呈召存田佃戍扒托宇行百半月弘永公戍示仿丟佞叼刪末丸戎吆白反皮呆朮君吼以好今羽危佃户允己包冷先牟朴式孑妄吉斥又廿永甲寸刪旬佣尺舌年天吾犬今再丙勻克朵于劫孔忙池仗各匣尹兄刈皿奸扎佇仇北付去公存別凶旭危百吶勿扎仰火用凹勿耒低兮禾刊四凹以以兆夷牝地匆作尼叼卯扣丕仙力君井妃汕天地文汝文灰予爪夫存衣立匆伏兀弗孓吭匈舛七己死只曰肋她兀乙尸氾朽月仿老古毋井打吋片佞比匝什少吞吳几先汐呈正歹屯安亥丹吃丙夸不吠另丫如扣吳出肌件夭台户旦冊舌伺斤伸叨自云左六卉才企仔次也卡伏亥你反曲旬衣句斥此永去玄免份吼`,
  [k.YOUR_RIGHTS_AND_WHEN_THEY_MAY]: `企并名乓小户夙千牙冷氾丟老打妄吳匣她孕扛呆羽手次式別川久刪考吝仰判引呎丙`,
